import React from "react";
import { Route, BrowserRouter, Routes } from "react-router-dom";

import Informacao from "./Informacao.js";


const Rout = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route Component={<Informacao />} path="/" exact />
      </Routes>
    </BrowserRouter>
  );
};

export default Rout;
